void sa_is (ull s[], sll sa[], ull n, ull ckind) {
	sll i;

	bool isS[n + 1];
	isS[n] = true;
	for (i = n - 1; i >= 0; i--) {
		if (s[i] < s[i + 1]) {
			isS[i] = true;
		} else if (s[i] > s[i + 1]) {
			isS[i] = false;
		} else {
			isS[i] = isS[i + 1];
		}
	}

	ull lms[n + 1], lmscnt = 0;
	for (i = 0; i <= n; i++) {
		if (is_lms(isS, i)) {
			lms[lmscnt++] = i;
		}
	}

	induced_sort(s, sa, isS, lms, n, lmscnt, ckind);

	ull lmssort[lmscnt], c = 0;
	for (i = 0; i <= n; i++) {
		ull v = sa[i];
		if (is_lms(isS, v)) {
			lmssort[c++] = v;
		}
	}

	ull nums[n + 1], num = 0;
	nums[lmssort[0]] = 0;
	bool isunique = true;
	for (i = 1; i < lmscnt; i++) {
		ull prev = lmssort[i - 1];
		ull curr = lmssort[i];

		bool issame = true;
		sll j = 0;
		while (true) {
			if (prev + j > n || curr + j > n || s[prev + j] != s[curr + j] || is_lms(isS, prev + j) != is_lms(isS, curr + j)) {
				issame = false;
				break;
			} else if (j && is_lms(isS, prev + j) && is_lms(isS, curr + j)) {
				break;
			}

			j++;
		}

		if (issame) {
			isunique = false;
		} else {
			num++;
		}
		nums[curr] = num;
	}

	if (!isunique) {
		ull densenums[lmscnt];
		for (i = 0; i < lmscnt; i++) {
			densenums[i] = nums[lms[i]];
		}
		sa_is(densenums, sa, lmscnt - 1, num + 1);
		for (i = 0; i < lmscnt; i++) {
			lmssort[i] = lms[sa[i]];
		}
	}

	induced_sort(s, sa, isS, lmssort, n, lmscnt, ckind);
}
